import { Box, withStyles } from "@material-ui/core";

interface IProps {
  testId: any;
}

export default function QuizTestResult({ testId }: IProps) {
  return <Container>{testId}</Container>;
}

const Container = withStyles({
  root: {
    width: "100vw",
    display: "flex",
    flexDirection: "column",
    justifyContent: "center",
  },
})(Box);
